import React from "react";
import pdf from "../../Resume.pdf";

export default function Resume() {
    return (
        <div>
            <iframe src={`${pdf}#view=fitH`} title="testPdf" height="100%" width="100%" />
            <a href={pdf}>Click here for my pdf</a>
        </div>
    )
}
